import React, { Component } from 'react';

class Home extends Component {
  render() {
    return (
      <div id='home'>
        <div className='w-50 vh-100 bg-danger'></div>
        <div className='col-4 vh-100 bg-info' id='image'>gfsdfsdf</div>
      </div>
    );
  }
}

export default Home;
